', '', '', '', '', '', '', '', '', '1682', '1', 'Intervensi Keperawatan: Monitor adanya kelelahan otot bantu nafas, Monitor status respirasi dan oksigenisasi, Pertahankan kepatenan jalan nafas, Bantu untuk merubah posisi jika diperlukan, Lakukan auskultasi bunyi pernafasan secara teratur, Identifikasi keadaan emosional ibu saat akan dilakukan konseling menyusui, Identifikasi keinginan dan tujuan menyusui, Identifikasi permasalahan yang ibu alami selama proses menyusui, Berikan informasi dan saran menyusui yang benar sesuai kebutuhan ibu.<div></div><div>Kolaborasi: Cek GDS/hari (selama puasa), R/ cek SHK IC(-), OGT dialirkan puasa sementara, fu expertise ro thorax (13/4/25), fu ro thorax abdominal 914/4/25) ,oles kolostrum di mulut/ 8 jam jika ada ASI.</div>', NULL, '1682', 0, NULL, '2025-04-14 17:43:57')
