ERROR - 2025-04-14 18:36:23 --> Query error: ERROR:  invalid byte sequence for encoding "UTF8": 0xba - Invalid query: INSERT INTO "sm_cppt" ("id_layanan_pendaftaran", "waktu", "id_profesi", "subject", "objective", "assessment", "plan", "ademi_assesment", "ademi_diag", "ademi_interv", "ademi_monev", "sbar_situation", "sbar_background", "sbar_assesment", "sbar_recommend", "id_nadis", "ttd_nadis", "instruksi_ppa", "id_dokter_dpjp", "id_user", "konsul_via_telp", "konsul", "created_date") VALUES ('727284', '2025-04-14 18:33', '18', '-', 'kesadran compomentis, akrla hangta, gerak aktif, tonuys otot+ trpasang lowflow 1 lpm terpasang infus D51/4 NS 2 cc/jam tersang ogt+ reflek hisap baik, s: 37 nadi; 134 kali/menit rr: 45 kali/menit spo2: 98b1 kali 100, bak 30 cc, ', 'pola nafas tidak efektif, gangguan integritas kulit', 'Setelah dilakukan tindakan keperawatan selama 5x24 jam, diharapkan Inspirasi dan atau ekspirasi yang memberikan ventilasi membaik dengan Kriteria Hasil: Ventilasi semenit meningkat, Dispnea menurun, Penggunaan otot bantu nafas menurun, Pernafasan cuping hidung menurun, Frekuensi nafas membaik, Kedalaman nafas membaik; Setelah dilakukan tindakan keperawatan 5x24 jam, diharapkan Integritas Kulit Dan Jaringan meningkat dengan Kriteria Hasil : Elastisitas normal, hidrasi meningkat, Hematoma menurun, Nyeri menurun, Suhu kulit membaik', '', '', '', '', '', '', '', '', '1689', '1', 'ntervensi Keperawatan: Monitor pola nafas (Frekuensi, kedalaman, usaha nafas), Monitor bunyi nafas tambahan (mis. gurgling, mengi, wheezing, ronchi kering), Pertahankan kepatenan jalan nafas, Posisikan semi fowler atau fowler, Berikan minum hangat, Berikan oksigen jika perlu,  Identifikasi penyebab gangguan integritas kulit (mis. Perubahan sirkulasi, perubahan status nutrisi, peneurunan kelembaban, suhu lingkungan ekstrem, penurunan mobilitas), Ubah posisi setiap 2 jam jika tirah baring, Lakukan pemijatan pada area penonjolan tulang, jika perlu, Gunakan produk berbahan petrolium atau minyak pada kulit kering, Gunakan produk berbahan ringan/alami dan hipoalergik pada kulit sensitif, Hindari produk berbahan dasar alkohol pada kulit kering<div></div><div></div><div>Kolaborasi: follow up expertise thorax (12/04/2025), post transfusi PRC 45ml dalam 4 jam selesai 13/04/2025 jam 13.00, sedang cek GDT-> hasil (+) lapor (+), terapi Hydrocortisone 2,5% oles 1x1 di bercak merah pada badan, cek DR post transfusi-> hasil (+) lapor (+), minum adlib</div>', NULL, '1689', 0, NULL, '2025-04-14 18:36:23')
